import useWebSocket, { ReadyState } from 'react-use-websocket';

const TagForm = () => {
  const { sendJsonMessage, lastJsonMessage, readyState } = useWebSocket('ws://localhost:8082');
  
  useEffect(() => {
    if (lastJsonMessage && lastJsonMessage.tag) {
      setTag(lastJsonMessage.tag);

      // Aqui você pode fazer o que quiser com a tag, por exemplo, atualizar o estado do componente
      console.log('Tag recebida:', lastJsonMessage.tag);
      
    }
  }, [lastJsonMessage]);

  return (
    <div>
      <p>WebSocket Status: {readyState === ReadyState.OPEN ? 'Connected' : 'Disconnected'}</p>
      {/* Renderize a tag na tela conforme necessário */}
      {lastJsonMessage && (
        <p>Tag Atual: {lastJsonMessage.tag}</p>
      )}
    </div>
  );
};

